var lazyImage=function(domEle){var obj=$(domEle),bgImgs=obj.find("[data-bgsrc]"),Imgs=obj.find("[data-src]");if(!obj&&!bgImgs&&!Imgs)return;if(obj.attr("data-bgsrc")){var url=obj.attr("data-bgsrc");obj.css("background-image",'url("'+url+'")')}if(obj.attr("data-src")){var url=obj.attr("data-src");obj.attr("src",url)}bgImgs.each(function(index){var url=$(this).attr("data-bgsrc");$(this).css("background-image",'url("'+url+'")')});Imgs.each(function(index){var url=$(this).attr("data-src");$(this).attr("src",url)})};window.lazyImage=lazyImage;